  `labels` varchar(256) DEFAULT NULL,
  `orderNo` int(11) DEFAULT '999',
  PRIMARY KEY (`id`),
  KEY `isTop` (`isTop`),
  KEY `state` (`state`),
  KEY `platformState` (`platformState`)
